import "../index.css";
import "../styles/AnimeMap.css";
import { func } from "prop-types";
function AnimeMap() {

function start(){
  let root = document.querySelector('#root')
 let targetBox = document.createElement("div")
 targetBox.classList.add("target-box")
 targetBox.style.top = "400px"
 targetBox.style.left = "400px"
 root.appendChild(targetBox)
}


  return (
    <> 
  <img src="./images/Anime.jpg" alt="" className="Anime-Map" onClick={start} ></img>
  </>
  );
}

export default AnimeMap;
